import React from 'react';
import API from '../API'
import {
  BrowserRouter as Router,
  Route,
  Switch
} from 'react-router-dom';

class Catalog extends React.Component {
  constructor(props) {
    super(props);
  }


  render() {
    return (
      <div>
        {this.props.match.params.id}
      </div>
    );
  }
}

export default Catalog;
